Ext.define('Base.view.grid.HatioGroupSummary', {

    /* Begin Definitions */

    extend: 'Ext.grid.feature.Grouping',

    alias : 'feature.hatio_group_summary',

    mixins: {
        summary: 'Ext.grid.feature.AbstractSummary'
    },

    /* End Definitions */

    init: function() {
        this.mixins.summary.init.call(this);
    },
    
    allCheckBoxDisplay: false,
    addButtonDisplay: false,
    removeButtonDisplay: false,
    
    attachEvents: function() {
        var me = this,
            view = me.view;

        view.on({
            scope: me,
            groupclick: me.onGroupClick,
            rowfocus: me.onRowFocus
        });

        view.mon(view.store, {
            scope: me,
            groupchange: me.onGroupChange,
            remove: me.onRemove,
            add: me.onAdd,
            update: me.onUpdate
        });

        if (me.enableGroupingMenu) {
            me.injectGroupingMenu();
        }

        me.pruneGroupedHeader();

        me.lastGroupField = me.getGroupField();
        me.block();
        me.onGroupChange();
        me.unblock();
    },
    
    onGroupClick: function(view, rowElement, groupName, e) {
    	var me = this;
    	var target = e.getTarget();
		if(target.name && target.name == "addButton"){
			this.addRow(view, groupName);
			return;
		}
		if(target.name && target.name == "removeButton"){
			this.removeRow(view, groupName);
			return;
		}
		if(target.name && target.name.length>12 && target.name.substring(0,12) == "summaryCheck"){
			if(target.checked){
				me['summaryCheck' + groupName] = true;
			}else{
				me['summaryCheck' + groupName] = false;
			}
			this.allCheckToogle(view, groupName, target);
			
			return;
		}
        var me = this;

        if (me.collapsible) {
            if (me.collapsedState[groupName]) {
                me.expand(groupName);
            } else {
                me.collapse(groupName);
            }
        }
    },

   /**
    * Modifies the row template to include the summary row.
    * @private
    * @return {String} The modified template
    */
   getFeatureTpl: function() {
        var tpl = this.callParent(arguments);

        if (this.showSummaryRow) {
            // lop off the end </tpl> so we can attach it
            tpl = tpl.replace('</tpl>', '');
            tpl += '{[this.printSummaryRow(xindex)]}</tpl>';
        }
        return tpl;
    },

    /**
     * Gets any fragments needed for the template.
     * @private
     * @return {Object} The fragments
     */
    getFragmentTpl: function() {
        var me = this,
        //fragments = me.callParent();
        fragments = me.getFragmentTplParentOverride();

        Ext.apply(fragments, me.getSummaryFragments());
        if (me.showSummaryRow) {
            // this gets called before render, so we'll setup the data here.
            me.summaryGroups = me.view.store.getGroups();
            me.summaryData = me.generateSummaryData();
        }
        return fragments;
    },

    /**
     * Gets the data for printing a template row
     * @private
     * @param {Number} index The index in the template
     * @return {Array} The template values
     */
    getPrintData: function(index){
        var me = this,
            columns = me.view.headerCt.getColumnsForTpl(),
            i = 0,
            length = columns.length,
            data = [],
            name = me.summaryGroups[index - 1].name,
            active = me.summaryData[name],
            column;

        for (; i < length; ++i) {
            column = columns[i];
            column.gridSummaryValue = this.getColumnValue(column, active);
            data.push(column);
        }
        return data;
    },
    
    getFragmentTplParentOverride: function() {
        var me = this;
        return {
            indentByDepth: me.indentByDepth,
            depthToIndent: me.depthToIndent,
            renderGroupHeaderTpl: function(values, parent) {
            	if(!me['summaryCheck' + values.name]){
            		me['summaryCheck' + values.name] = false;
            	}
            	
            	var chk = '';
            	if(me.allCheckBoxDisplay){
	            	chk = '<input type="checkbox" name="summaryCheck'+values.name+ '"/>&nbsp;';
	            	if(me['summaryCheck' + values.name]){
	            		chk = '<input type="checkbox" name="summaryCheck'+values.name+ '" checked/>&nbsp;';
	            	}
            	}
            	
            	var etc = '';
            	if(me.etcGroupName){
            		if(values.children.length){
            			etc = '(' + values.children[0].data[me.etcGroupName] + ')';
            		}
            	}
            	
            	var add = '';
            	if(me.addButtonDisplay){
            		add = '&nbsp;&nbsp;&nbsp;<img name="addButton" width="10" height="10" src="data:image/png;base64,">'; 
            	}
            	
            	var remove = '';
            	if(me.removeButtonDisplay){
            		remove = '&nbsp;&nbsp;<img name="removeButton" width="10" height="10"  src="data:image/png;base64,">';
            	}
            	
                return chk + Ext.XTemplate.getTpl(me, 'groupHeaderTpl').apply(values, parent) + etc + add + remove;
            }
        };
    },
    
    addRow: function(view, groupName){
    	var store = view.store; 
    	var obj = new Object();
		obj[store.groupField] = groupName;
		var model = store.createModel(obj);
        store.add(model);
        store.commitChanges();
        this.addFocusRow(store, groupName);
    },
    
    removeRow: function(view, groupName){
    	var oldScroll = view.getEl().dom.scrollTop;
    	var store = view.store; 
    	var removeRecordArr = [];
    	store.each(function(rec){
    		if(rec.data.checked && rec.data.checked==true && rec.data[store.groupField]==groupName){
    			removeRecordArr.push(rec)
    		}
    	});
    	for(var i=0; i<removeRecordArr.length; i++){
    		store.remove(removeRecordArr[i]);
    		store.afterCommit(removeRecordArr[i]);
    	}
    	view.getEl().dom.scrollTop = oldScroll;
    },
    
    allCheckToogle: function(view, groupName, target){
    	var oldScroll = view.getEl().dom.scrollTop;
    	var checked = target.checked;
    	var store = view.store; 
    	store.each(function(rec){
    		if(rec.data[store.groupField] == groupName){
            	rec.data.checked = checked;
            	rec.commit();
    		}
         });
         view.getEl().dom.scrollTop = oldScroll;
    },
    
    addFocusRow: function(store, groupName){
    	var count = 0;
    	var myCount = 0;
    	var stop = false;
    	store.each(function(rec){
    		if(rec.data[store.groupField]==groupName){
    			myCount++;
    			stop = true;
    		}
    		if(!stop){
    			count++;
    		}
    	});
    	this.grid.getView().focusRow(count+myCount-1);
    },
    

    /**
     * Generates all of the summary data to be used when processing the template
     * @private
     * @return {Object} The summary data
     */
    generateSummaryData: function(){
        var me = this,
            data = {},
            remoteData = {},
            store = me.view.store,
            groupField = this.getGroupField(),
            reader = store.proxy.reader,
            groups = me.summaryGroups,
            columns = me.view.headerCt.getColumnsForTpl(),
            remote,
            i,
            length,
            fieldData,
            root,
            key,
            comp,
            summaryRows,
            s,
            sLen,
            convertedSummaryRow;

        for (i = 0, length = groups.length; i < length; ++i) {
            data[groups[i].name] = {};
        }

        /**
         * @cfg {String} [remoteRoot=undefined]
         * The name of the property which contains the Array of summary objects.
         * It allows to use server-side calculated summaries.
         */
        if (me.remoteRoot && reader.rawData) {
            // reset reader root and rebuild extractors to extract summaries data
            root = reader.root;
            reader.root = me.remoteRoot;
            reader.buildExtractors(true);
            summaryRows = reader.getRoot(reader.rawData);
            sLen      = summaryRows.length;

            // Ensure the Reader has a data conversion function to convert a raw data row into a Record data hash
            if (!reader.convertRecordData) {
                reader.buildExtractors();
            }

            for (s = 0; s < sLen; s++) {
                convertedSummaryRow = {};

                // Convert a raw data row into a Record's hash object using the Reader
                reader.convertRecordData(convertedSummaryRow, summaryRows[s]);
                remoteData[convertedSummaryRow[groupField]] = convertedSummaryRow;
            }

            // restore initial reader configuration
            reader.root = root;
            reader.buildExtractors(true);
        }

        for (i = 0, length = columns.length; i < length; ++i) {
            comp = Ext.getCmp(columns[i].id);
            fieldData = me.getSummary(store, comp.summaryType, comp.dataIndex, true);

            for (key in fieldData) {
                if (fieldData.hasOwnProperty(key)) {
                    data[key][comp.id] = fieldData[key];
                }
            }

            for (key in remoteData) {
                if (remoteData.hasOwnProperty(key)) {
                    remote = remoteData[key][comp.dataIndex];
                    if (remote !== undefined && data[key] !== undefined) {
                        data[key][comp.id] = remote;
                    }
                }
            }
        }
        return data;
    }
});